import { createTheme } from "@mui/material";

export const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#ce93d8',
      ligth: '#f3e5f5',
      dark: '#ab47bc',
      contrastText: '#42a5f5',
    },
    background: {
      paper: '#001e3c',
      default: '#001e3c',
    },
  },
});
